	this._color = color;
	/** @member {Node|Leaf} The left child */
	this.left = new Leaf(this);
	/** @member {Node|Leaf} The right child */
	this.right = new Leaf(this);
	/** @member {Node} The parent node. */
	this.parent = null;
	/** @member {any} The key held by this node. */
	this.key = key;
